import React from 'react';
import Person from './Person'


const Personlist = ({people})=>{
     const list = people.map((user, i)=>{
    return (
        <div>
            <img src= 'https://api.adorable.io/avatars/200/people[i]..png' alt='every-day people' 
                className='br-100 mt1 contain'/>
            <Person 
                    
            name={people[i].name} 
            email={people[i].email}
                street1={people[i].address.street}
                street2={people[i].address.suite}
                street3={people[i].address.city}
            />
        </div>)
 
})
    return (
        <div>
           
           {list} 
        </div>
    )
}

export default Personlist
